import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <nav style={{marginBottom: 20}}>
      <Link to="/">Home</Link> |{' '}
      <Link to="/users">Users</Link> |{' '}
      <Link to="/orgs">Organizations</Link> |{' '}
      <Link to="/login">Login</Link>
    </nav>
  );
}

export default Navbar;
